func testStockToManyRemoveOpFulfillmentLines(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Stock
	var b, c, d, e FulfillmentLine

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, stockDBTypes, false, strmangle.SetComplement(stockPrimaryKeyColumns, stockColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*FulfillmentLine{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, fulfillmentLineDBTypes, false, strmangle.SetComplement(fulfillmentLinePrimaryKeyColumns, fulfillmentLineColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddFulfillmentLines(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.FulfillmentLines().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveFulfillmentLines(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.FulfillmentLines().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if !queries.IsValuerNil(b.StockID) {
		t.Error("want b's foreign key value to be nil")
	}
	if !queries.IsValuerNil(c.StockID) {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.Stock != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.Stock != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.Stock != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.Stock != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.FulfillmentLines) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.FulfillmentLines[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.FulfillmentLines[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

func testStockToOneProductVariantUsingProductVariant(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Stock
	var foreign ProductVariant

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, stockDBTypes, false, stockColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Stock struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, productVariantDBTypes, false, productVariantColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize ProductVariant struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	local.ProductVariantID = foreign.ID
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.ProductVariant().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if check.ID != foreign.ID {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	ranAfterSelectHook := false
	AddProductVariantHook(boil.AfterSelectHook, func(ctx context.Context, e boil.ContextExecutor, o *ProductVariant) error {
		ranAfterSelectHook = true
		return nil
	})

	slice := StockSlice{&local}
	if err = local.L.LoadProductVariant(ctx, tx, false, (*[]*Stock)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.ProductVariant == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.ProductVariant = nil
	if err = local.L.LoadProductVariant(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.ProductVariant == nil {
		t.Error("struct should have been eager loaded")
	}

	if !ranAfterSelectHook {
		t.Error("failed to run AfterSelect hook for relationship")
	}
}

